let style = {
    width: 100,
    height: 30,
    backgroundColor: "#063b50",
    borderRadius: '0 5px 0 0',
    cursor: 'pointer',
}

let settingsLine = {
    width: 18,
    height: 1,
    backgroundColor: '#e4f7ff',
    margin: 'auto'
}

let ddl = {
    width: '100%',
    height: 50,
    backgroundColor: "#063b50",
}

export default function Settings() {
    return (
        <div>
            <div style={style}>
                <div style={{...settingsLine, marginTop: 0}}></div>
                <div style={{...settingsLine, marginTop: 4}}></div>
                <div style={{...settingsLine, marginTop: 4}}></div>
            </div>
        </div>
    )
}
